import React, { useState } from "react";
import { useWallet, ConnectButton } from "@suiet/wallet-kit";
import { providers, Contract, utils } from 'ethers';

const ETH_CONTRACT_ADDRESS = "0x5FbDB2315678afecb367f032d93F642f64180aa3";
const ETH_CONTRACT_ABI = [
    {
        "inputs": [],
        "name": "convertETHToIBT",
        "outputs": [],
        "stateMutability": "payable",
        "type": "function"
    },
    {
        "inputs": [
            {"name": "spender", "type": "address", "internalType": "address"},
            {"name": "amount", "type": "uint256", "internalType": "uint256"}
        ],
        "name": "approveTokenForBridge",
        "outputs": [{"name": "", "type": "bool", "internalType": "bool"}],
        "stateMutability": "nonpayable",
        "type": "function"
    },
    {
        "inputs": [
            {"name": "bridgeContract", "type": "address", "internalType": "address"},
            {"name": "amount", "type": "uint256", "internalType": "uint256"}
        ],
        "name": "transferTokensToBridge",
        "outputs": [],
        "stateMutability": "nonpayable",
        "type": "function"
    }
];

const App = () => {
    const [ethereumAccount, setEthereumAccount] = useState("");
    const [amount, setAmount] = useState("");
    const [isTransacting, setIsTransacting] = useState(false);
    const wallet = useWallet();

    const connectEthereumWallet = async () => {
        if (typeof window.ethereum !== "undefined") {
            try {
                const accounts = await window.ethereum.request({
                    method: "eth_requestAccounts",
                });
                setEthereumAccount(accounts[0]);
            } catch (error) {
                console.error("MetaMask connection failed:", error);
            }
        } else {
            alert("MetaMask is not installed!");
        }
    };

    const bridgeToSui = async () => {
        if (isTransacting || !ethereumAccount || !wallet.connected || !amount) {
            alert("Connect both wallets and specify an amount");
            return;
        }

        try {
            setIsTransacting(true);
            const provider = new providers.JsonRpcProvider("http://127.0.0.1:8545");
            const signer = new providers.JsonRpcSigner(provider, ethereumAccount);
            const contract = new Contract(ETH_CONTRACT_ADDRESS, ETH_CONTRACT_ABI, signer);

            console.log("Converting ETH to IBT...");
            const weiAmount = utils.parseEther(amount);
            const convertTx = await contract.convertETHToIBT({ 
                value: weiAmount,
                from: ethereumAccount,
                gasLimit: 100000
            });
            await convertTx.wait();

            const ibtAmount = weiAmount.mul(1000);
            const approveTx = await contract.approve(ETH_CONTRACT_ADDRESS, ibtAmount);
            await approveTx.wait();

            const transferTx = await contract.transferTokensToBridge(ETH_CONTRACT_ADDRESS, ibtAmount);
            await transferTx.wait();

            const suiTransaction = {
                packageObjectId: "0xa38a14567bb2c4d10a171ecaea7eff277c03758b8cd0ad72e24f92ae6a167a68",
                module: "suipart",
                function: "mint",
                typeArguments: ["0xa38a14567bb2c4d10a171ecaea7eff277c03758b8cd0ad72e24f92ae6a167a68::suipart::SUIPART"],
                arguments: [
                    "0xa38a14567bb2c4d10a171ecaea7eff277c03758b8cd0ad72e24f92ae6a167a68",
                    ibtAmount.toString(),
                    wallet.address
                ],
                gasBudget: 10000000
            };

            const suiResult = await wallet.signAndExecuteTransaction({
                transaction: { kind: "moveCall", data: suiTransaction }
            });
            console.log("Sui Result:", suiResult);

            alert("Successfully bridged tokens!");
        } catch (error) {
            console.error("Bridge Error:", error);
            alert(`Bridge failed: ${error.message}`);
        } finally {
            setIsTransacting(false);
        }
    };

    return (
        <div className="flex flex-col items-center justify-center min-h-screen p-4">
            <h1 className="text-2xl font-bold mb-4">Cross-Chain Bridge ðŸŒ‰</h1>
            <div className="mb-4">
                <button
                    onClick={connectEthereumWallet}
                    className="px-4 py-2 bg-blue-500 text-white rounded shadow"
                    disabled={isTransacting}
                >
                    Connect Ethereum Wallet
                </button>
                {ethereumAccount && <p>Connected: {ethereumAccount}</p>}
            </div>
            <div className="mb-4">
                <ConnectButton />
                {wallet.connected && <p>Connected: {wallet.address}</p>}
            </div>
            <div className="mb-4">
                <input
                    type="number"
                    placeholder="Amount in ETH"
                    value={amount}
                    onChange={(e) => setAmount(e.target.value)}
                    className="p-2 border rounded w-64"
                    disabled={isTransacting}
                />
            </div>
            <button
                onClick={bridgeToSui}
                className="px-4 py-2 bg-purple-500 text-white rounded shadow"
                disabled={isTransacting}
            >
                {isTransacting ? 'Processing...' : 'Bridge Tokens'}
            </button>
        </div>
    );
};

export default App;
